import React from "react";
import './home.css';

export default function Home() {
    return (
        <div className="welcome">
            <p className="welcome__message">
            Welcome! &#127881;  My name is,
            </p>
            <div className="welcome__wrap">
            <ul className="welcome__wrap__namelist">
                <li className="welcome__wrap__name">Han, Lawrence</li>
                <li className="welcome__wrap__name">Lawrence Han</li>
                <li className="welcome__wrap__name">한희문</li>
                <li className="welcome__wrap__name">Larry</li>
            </ul>
            </div>
            <p className="welcome__enter">
            click anywhere to enter
            </p>
        </div>
    )
};
